import React, {useState} from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                  <Link to="/" className="navbar-logo">
                      EQUIPMENT<i className="fab fa-typo3" />
                  </Link>
                  <div></div>
                </div>
            </nav>
        </>
    )
}

export default Navbar
